import { useParams } from "react-router-dom"
import useFetch from "../../hooks/useFetch"

function Character() {
  const { id } = useParams()
  const info = useFetch(`https://rickandmortyapi.com/api/character/${id}`)

  return (
    <main className="Character">
      Personaje: {info?.name}
    </main>
  )
}

export default Character
